#include "Util.hpp"
class Solution {
public:
    string str_s;
    string str_t;
    int equalSubstring(string s, string t, int maxCost) {
        this->str_s = s;
        this->str_t = t;

        vector<vector<std::pair<int,int>>> memo(s.size(),vector<std::pair<int,int>>(maxCost+1,{-1,-1}));//index -> [0->-1,1->-1..cost->]
        return dp_helper(0,0,maxCost,memo);

    }



    /**
     *
     * @param isFirstMust 0 表示false 1表示true 第一个元素也需要替换
     * @param index
     * @param cost
     * @param memo
     * @return
     */
    int dp_helper(int isFirstMust, int index,int cost,vector<vector<std::pair<int,int>>>& memo){
        auto& pair = memo[index][cost];
        auto& pair_value = (isFirstMust == 1) ? pair.second : pair.first;

        if (pair_value != -1){
            std::cout << "memo" << std::endl;
            return pair_value;
        }
        int ret = dp(isFirstMust,index,cost,memo);
        pair_value = ret;

        return ret;
    }

    int dp(int isFirstMust,int index,int cost,vector<vector<std::pair<int,int>>>& memo){
        if (index == str_s.size() -1){
            if (cost >= abs(str_t[index] - str_s[index])){
                return 1;
            }else{
                return 0;
            }
        }

        if (cost >=0){
            int ret_1 = INT_MIN;
            int ret_2 = INT_MIN;

            //替换首元素
            if (cost >= abs(str_t[index] - str_s[index])){
                ret_1 = 1 + dp_helper(1,index+1, (cost-abs(str_t[index] - str_s[index])),memo);
            }else{
                ret_1 = 0;
            }

            if (isFirstMust == 0){//isFirstMust==0，可以有新的选择
                ret_2 = dp_helper(0,index+1,cost,memo);
            }

//            std::cout << "index" << index << std::endl;
            return std::max(ret_1,ret_2);
        }else{
            return 0;
        }
    }
};


int main() {
    Solution solution;
    string s = ""
               ;
    string t = ""
    ;
    std::cout << solution.equalSubstring(s,t,15423) << std::endl;
}